import React from 'react';
import {
  Card, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle, Button
} from 'reactstrap';
import './App.css';


const CardService = (props) => {

  return (

    <div>

      <Card>
      <CardTitle>{props.details.categoria}</CardTitle>

        <CardBody>
          <CardImg top width="100%" src="/assets/318x180.svg" alt="Card image cap" />
          <CardTitle tag="h3">{props.details.nomedavaga}</CardTitle>
          <CardSubtitle tag="h6">{props.details.empresa}</CardSubtitle>
          <CardText>{props.details.horas}</CardText>
          <CardText>{props.details.cidade}</CardText>
          <Button>Participar</Button>
        </CardBody>
      </Card>

      
    </div>

  );
};

export default CardService;
